import React,{Component} from 'react';
import Login from '../../components/Login/Login';
import ToastMessage from '../../components/ToastMessage/ToastMessage';
import './LogInPage.css'

class LogInPage extends Component{
    constructor(props){
        super(props);
        this.state = {
            LogInMessage: ""
        }
    }
    toastMessageHandler = (message)=>{
        this.setState({LogInMessage:message});
    }
    render(){
        return(
            <div className="logInPage">
                <ToastMessage message = {this.state.LogInMessage}/>
                <Login toastMessageHandler = {(message)=>{this.toastMessageHandler(message)}}/>
                <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSo4kdHSVd5HhGRolR5Jn92_rFENn53ZWWb0oYAn6bPQsbQRPXghg&s" className="backgroundImage" alt=""/>
            </div>
        );
    }
}

export default LogInPage;
